actionConfiguration.body:
async () => {
  if (!appsmith.store.user_id) {
    showAlert("请先登录！", "warning");
    navigateTo('LoginPage');
    return;
  }
  const currentContextPerm = 'SUBMIT:FEEDBACK';
  if (currentContextPerm && !appsmith.store.GLOBAL_PERMS?.includes(currentContextPerm)) {
    showAlert('权限不足：您无权访问此页面', 'error');
    navigateTo('首页');
    return;
  }
  try {} catch (e) {
    console.log(e);
  }
}

